var tipuesearch = {"pages":[{"url":"./pages/about/","tags":"misc","text":"2017Spring 機械設計工程系協同產品設計實習 課程倉儲: https://github.com/40423101/2017springcd_hw 課程投影片: https://40423101.github.io/2017springcd_hw/#/ 課程網誌: https://40423101.github.io/2017springcd_hw/blog/","title":"About"},{"url":"./期中報告.html","tags":"homework","text":"1.利用solvespace進行點路徑的分析 2.用Excel進行點的分析 3.利用程式繪製路徑 (1)利用solvespace進行點路徑的分析 (2)用Excel進行點的分析 (3)利用程式繪製路徑 window.onload=function(){ // 設定 data/py 為共用程式路徑 brython({debug:1, pythonpath:['./../data/py']}); } from browser import document as doc from browser import html import math # 準備繪圖畫布 canvas = doc[\"fourbar\"] ctx = canvas.getContext(\"2d\") fourbar_data = open(\"./../data/40423101.csv\").read() fourbar_list = fourbar_data.splitlines() #container1 <= fourbar_list[0] # 以下可以利用 ctx 物件進行畫圖 # 先畫一條直線 ctx.beginPath() # 設定線的寬度為 1 個單位 ctx.lineWidth = 1 # 利用 transform 將 y 座標反轉, 且 offset canvas.height # (X scale, X skew, Y skew, Y scale, X offset, Y offset) # 配合圖形位置進行座標轉換 ctx.transform(1, 0, 0, -1, canvas.width/2+250, canvas.height/2+100) # 畫出 x 與 y 座標線 # 各座標值放大 3倍 ratio = 3 ctx.moveTo(0, 0) ctx.lineTo(-30*ratio, 0) start_point = fourbar_list[0].split(\",\") ctx.moveTo(float(start_point[0])*ratio, float(start_point[1])*ratio) count = 0 for data in fourbar_list[1:]: point = data.split(\",\") #count = count + 1 #container1 <= str(count) + \":\" + point[0] + \",\" + point[1] #container1 <= html.BR() ctx.lineTo(float(point[0])*ratio, float(point[1])*ratio) # 設定顏色為藍色, 也可以使用 \"rgb(0, 0, 255)\" 字串設定顏色值 ctx.strokeStyle = \"blue\" # 實際執行畫線 ctx.stroke() ctx.closePath() 小組作業 40423101負責組合 虎尾科技大學-機械設計系-40423101-ag2 組合 from 曾宜萱 on Vimeo .","title":"期中報告"},{"url":"./W6.html","tags":"homework","text":"1.多連桿繪製 2.多連桿-組裝 多連桿繪製 多連桿繪製 from 曾宜萱 on Vimeo . 多連桿-組裝 多連桿組立 from 曾宜萱 on Vimeo .","title":"第六周"},{"url":"./W5.html","tags":"homework","text":"單連桿-匯入vrep做轉動模擬 單連桿-匯入vrep做轉動模擬 虎尾科技大學-機械設計系-40423101-單連桿-匯入vrep做轉動模擬 from 曾宜萱 on Vimeo . 心得 這次的轉動模擬看了很多次老師的影片終於學會了","title":"第五周"},{"url":"./W4.html","tags":"homework","text":"1.solvepace繪製單連桿 2.單連桿-匯入vrep 單連桿-零件1 單連桿-零件1 from 曾宜萱 on Vimeo . 單連桿-零件2 單連桿-零件2 from 曾宜萱 on Vimeo . 單連桿-零件3 單連桿-零件3 from 曾宜萱 on Vimeo . 單連桿-組裝 單連桿-組裝 from 曾宜萱 on Vimeo . 單連桿-匯入vrep 單連桿匯入vrep from 曾宜萱 on Vimeo .","title":"第四周"},{"url":"./W3.html","tags":"homework","text":"1.將多連桿匯入Vrep 2.Excel運算多連桿軌跡 3.翻譯Hyperworker影片 將多連桿匯入Vrep(solvespace) 將多連趕匯入Vrep from 曾宜萱 on Vimeo . 追蹤多連桿軌跡匯入Excel運算 trace 多連桿的一點 轉入 Excel運算 from 曾宜萱 on Vimeo . 將多連桿匯入Vrep(onshape) 將多連趕匯入Vrep(onshape) from 曾宜萱 on Vimeo . 翻譯Hyperworker1 In the 2017 release, we followed our vision and implement a lot more features, delivering more technology for your HyperWorks units investment. 在2017年版本中，我們遵循了我們的願景並實施了更多功能，為您的HyperWorks單位投資提供更多技術。 In our continuous development, we focused, as# always, on simulation-driven innovation, adding more optimization technology. 在我們的不斷發展中，我們一如既往地專注於模擬驅動的創新，增加更多的優化技術。 We added more physics simulation to the software, and we improved our parallel performance on high performance computers. 我們增加了許多的物理的模擬，我們提高了高性能電腦的平行性能。 OptiStruct, which is our implicit code, adds a lot of development in the nonlinear implicit area, but also in the optimization technology. OptiStruct是我們的隱式代碼，在非線性隱含區域中，也在優化技術中添加了很多開發。 RADIOSS, we see a lot of development in new materials and material modeling. RADIOSS，我們看到很多新材料和材料建模的發展。 You probably know that we did the acquisition of MDS a couple of years back, and we have now MDS integrated with RSDIOSS, and are doing application there. 您可能知道我們在幾年前就完成了MDS的收購，現在我們已經將MDS與RSDIOSS整合，並開始應用。 MotionSolve is based on a very unique formulation that this different from other multibody dynamics code, and the formulation lends itself very well to optimization implementation. MoMotionSolvetionSolve是根據一個非常獨特的公式，這不同於其他多體動力學代碼，MotionSolve公式本身非常好地優化實施。 So the team has worked really hard on contact formulations, got very robust. 因此團隊對於接觸公式非常努力，獲得了非常強大的。 It's very cool which kind of problems can solve with contact modelling. 這類型的問題可以解決與接觸建模這是非常酷的。 So this is along the structural solvers side on AcuSolve side we actually added the complete portfolio of turbulence and transition models that really helps us to solve problems in wind turbines and automotive industry much more accurately, and it's a big asset of physics simulation. 因此，這是沿著AcuSolve一側的結構解算方面，我們實際添加了完整的湍流和轉換模型組合，真正幫助我們更準確地解決風力渦輪機和汽車行業的問題，這是物理仿真的一個重要的資產。 And then our electromagnetic suite has actually grown last year through the acquisition of Flux, from the CEDRAT company. 然後，我們的電磁套件實際上是去年通過從CEDRAT公司收購Flux而實現的。 As well as the acquisition of WinProp, from AWE. 以及從AWE收購WinProp。 So now we have a complete frequency spectrum from low frequency electromagnetics the high frequency electromagnetics which is powered by FEKO. 所以現在我們有一個完整的頻譜從低頻電磁學的高頻電磁學由FEKO供電。 We now have a complete portfolio of physics modeling available for our customers, and it's all linked through optimization. 我們現在有一個完整的物理建模組合可用於我們的客戶，它都通過優化鏈接。 翻譯Hyperworker3 In OptiStruct, one of our focus areas is nonlinear large deformation analysis. 在OptiStruct中，我們的一個重點領域是非線性大變形分析。 And in 2017 we added nonlinear transient analysis. 在2017年，我們添加了非線性瞬態分析 The main purpose was to couple AcuSolve to do fluid-structure interaction. 主要目的是使AcuSolve與流體 - 結構相互作用。 But also one development that happened during the last year came out piece-wise in different point releases and is now really mature. 但是，在過去一年中發生的一個發展，在不同的積分發布中分段出現，現在已經成熟。 And 2017 is our contact analysis, so we have different ways of defining sliding contact and things like that. 2017年是我們的接觸分析，所以我們有不同的方式來定義滑動接觸和類似的東西。 The fast contact analysis for small deformation is blazing fast. 對小變形的快速接觸分析是快速的。 It's a very simple idea that makes the solution very fast, and that adds OptiStruct as really a leading nonlinear structural solver. 這是一個非常簡單的想法，使解決方案非常快，並將OptiStruct添加為真正的領先的非線性結構求解器。 Our two major optimization packages are OptiStruct for structural optimization, there's a huge multidisciplinary component, too. 我們的兩個主要優化包是用於結構優化的OptiStruct，還有一個巨大的多學科組件。 And Hyperstudy for general optimization wrap around multidisciplinary optimization. 並且Hyperstudy對一般優化包圍多學科優化。 [For] OptiStruct we spend a lot of time continuing the development for optimization and we have now Failsafe topology optimization. [For] OptiStruct我們花了很多時間繼續開發優化，我們現在已經失效的拓撲優化。 We kept on working on the manufacturing solution to do lattice optimization. 我們一直在製造解決方案上做晶格優化。 For the multi-model optimization it's really maturing and we find more and more applications where that helps. 對於多模型優化，它真的成熟，我們發現越來越多的應用程序，這有助於。 Our goal is actually to include all the physics in the optimizations. 我們的目標實際上是在優化中包括所有的物理。 So the team right now is working on optimization for nonlinear problems and so on. 所以團隊現在正在努力優化非線性問題等等。 And then Hyperstudy, on the other hand, is going through a new transformation of the user the user experience was changed a few years back, but we are now trying to make it much more easy to use by hiding a lot of the advanced functionalities to the regular users. 另一方面，Hyperstudy正在經歷用戶體驗在幾年前改變的用戶體驗的一個新的轉變，但是我們現在試圖通過隱藏許多高級功能來使它更容易使用 普通用戶。 And depending on the level of expertise or depending on the job that the user has to do, they can customize the user experience. 並且取決於專業水平或者根據用戶必須做的工作，他們可以定制用戶體驗。 We adds a few new connections. 我們添加了一些新的連接。 One of them is a Flux connection. 其中一個是Flux連接。 Flux is an electromagnetics code that we just acquired for low frequency electromagnetics, so we can all take a Flux database and put it into Hyperstudy into the study with that. Flux是我們剛剛為低頻電磁學採集的電磁學代碼，所以我們可以採用一個Flux數據庫，並把它放入Hyperstudy進行研究。 心得 這次要翻譯字幕查了很多單字，也學到了很多字，讓自己更有耐心看英文","title":"第三周"},{"url":"./W2.html","tags":"homework","text":"1.solvepace30,50,60連桿繪製 2.solvepace組合零件 solvepace零件繪製 30mmbar Bar(30mm) from 曾宜萱 on Vimeo . 50mmbar Bar(50mm) from 曾宜萱 on Vimeo . 60mmbar Bar(60mm) from 曾宜萱 on Vimeo . 繪製連桿位置 Bar(路徑) from 曾宜萱 on Vimeo . 多連桿組立 Bar(組立) from 曾宜萱 on Vimeo . 心得 雖然上學期就開始使用solvespace,但還是有許多功能是我還沒學過的,這次上課學到chord tolerance是調整圓的平滑度","title":"第二周"},{"url":"./W1.html","tags":"homework","text":"1.onshape30,50,60連桿繪製 2.onshape組合零件 onshape零件繪製 30mmbar 30mmbar(onshape) from 曾宜萱 on Vimeo . 50mmbar 50mmbar(onshape) from 曾宜萱 on Vimeo . 60mmbar 60mmbar(onshape) from 曾宜萱 on Vimeo . 多連桿組立 多連趕組合(onshape) from 曾宜萱 on Vimeo . 心得 這是第一次使用onshape組合零件,一開始真的很不習慣指令的方式,點跟點使用了緊密配合所以一動也不動,後來發現要用轉動配合,使用後連桿就可以移動了","title":"第一周"}]};